const renderPlayersList = (players, handleSelectPlayer) => {
  const playersList = players.map((player, index) => {
    const { username, photo } = player;
    return (
      <li key={`player${index}`} onClick={handleSelectPlayer}>
        <div>
          <img src={photo} />
          <p>{username}</p>
        </div>
      </li>
    );
  });
  return playersList;
};

export default renderPlayersList;
